import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { HttpClientModule } from '@angular/common/http';
import { RouterModule } from '@angular/router';

import { AppComponent } from './app.component';
import { MainPageComponent } from 'src/components/main-page/main-page.component';
import { ProductService } from './adapters/product.repository.adapter';
import { NavbarComponent } from 'src/components/sidebar/sidebar.componen';
import { LoginComponent } from 'src/components/login/login.component';
import { AppRoutingModule } from './app-routing.module';  // Importa el AppRoutingModule

@NgModule({
  declarations: [
    AppComponent,
    MainPageComponent,
    NavbarComponent,
    LoginComponent
  ],
  imports: [
    BrowserModule,
    HttpClientModule,
    RouterModule.forRoot([]),  // Esta configuración debe ser eliminada
    AppRoutingModule  // Asegúrate de incluir el AppRoutingModule aquí
  ],
  providers: [ProductService],
  bootstrap: [AppComponent]
})
export class AppModule { }
